        "fct-descr": "\u003cp\u003eOur first example comes from Cardelli's paper: defining the type\n Prop(n), of n-ary propositions. That is, \n\u003c/p\u003e\u003cpre\u003e   Prop(2) should be the type       Bool -\u003e Bool -\u003e Bool\n   Prop(3) is the type of functions Bool -\u003e Bool -\u003e Bool -\u003e Bool\n\u003c/pre\u003e\u003cp\u003eetc. \n\u003c/p\u003e\u003cp\u003eCardelli's paper (p. 10) writes this type as\n\u003c/p\u003e\u003cpre\u003elet Prop:: AllKK(N:: NatK) Type =\n     recK(F:: AllKK(N:: NatK) Type)\n         funKK(N:: NatK) caseK N of 0K =\u003e Bool; succK(M) =\u003e Bool -\u003e F(M);\n\u003c/pre\u003e\u003cpre\u003elet and2: Prop(2K) =\n     fun(a: Bool) fun(b: Bool) a & b;\n\u003c/pre\u003e\u003cp\u003eHere 0K and 2K are type-level numerals of the kind NatK; recK is the\n type-level fix-point combinator. The computed type Prop(2) then gives\n the type to the term and2.\n\u003c/p\u003e\u003cp\u003eIn our system, this example looks as follows:\n\u003c/p\u003e",
